	["am_zebra"] = { name = "Teurastus", desc = "Maalattu seepranraitakuviolla, johon on käytetty eri tavalla heijastavia alumiini- ja kromimaaleja. Tämän jälkeen päälle on lisätty karamellinen tomaatinpunainen väri.\n\nValeria ei maksa Javierille kysymysten kysymisestä... vaan vastausten kaivamisesta" },
