	["an_gunmetal_bravo"] = { name = "an_gunmetal_bravo", desc = "Tämä Siegestä tuotu muistoesine on maalattu anodisoidulla asemetallitehostevärillä kromisen pohjavärin päälle.\n\nEt tunne Felix Rileytä niin kuin minä... sitä miestä ei voi murtaa - Petturi ja totuudenetsijä osa 1" },
	["am_ossify_blue_p2000_bravo"] = { name = "am_ossify_blue_p2000_bravo", desc = "Tämä Seasidesta tuotu muistoesine on maalattu läpikuultavan sinisellä ja abstraktisti kuvioidulla hydrografilla metallisen pohjavärin päälle.\n\nAallot murtuvat, meidän mielemme eivät - Kotaro Izaki, murtoekspertti" },
	["am_crumple_bravo"] = { name = "am_crumple_bravo", desc = "Tässä Agencystä tuotu muistoesine on maalattu eri tavalla heijastavilla, monikuvioisilla metalliväreillä kromisen pohjavärin päälle.\n\nKynät maahan, kädet ylös" },
	["aq_steel"] = { name = "aq_steel", desc = "Se on edelleen täysin toimiva, vaikka ulkopinta onkin ruostunut.\n\nJoidenkin ei tarvitse peitellä likaisia tekojaan." },
	["hy_hex"] = { name = "hy_hex", desc = "Maalattu kuusikulmiokuvioidulla hydrografilla." },
	["hy_camo_large"] = { name = "hy_camo_large", desc = "Maalattu ylimitoitetulla maastokuviolla." },
	["am_ddpatdense"] = { name = "am_ddpatdense", desc = "Päällystetty metallisella kalvolla, johon on leimattu digital disruptive pattern -kuviota." },
	["twigs"] = { name = "twigs", desc = "Spray-maalattu vapaalla kädellä käyttäen oksia sapluunana." },
	["varicamo"] = { name = "varicamo", desc = "Maalattu käyttämällä VariCamo-kuviota.\n\nUudelleenrakentaminen seuraa ainoastaan tuhoamisen jälkeen." },
	["aq_damascus_knife"] = { name = "aq_damascus_knife", desc = "Valettu harkosta, jossa on kahta eri hiiliterästä.\n\nLopultakin päättäväisyyttäsi vastaava ase" },
	["am_crystallized"] = { name = "am_crystallized", desc = "Maalattu metallisella maalilla, johon on luotu kristallikuvio.\n\nKaikki haluavat jättää jälkensä." },
	["snakeskin"] = { name = "snakeskin", desc = "Maalattu käärmeenihokuvioisella hydrografilla.\n\nTiedän, ettet usko aatteeseemme... ja kun paljastan aikeesi, Valeria ei anna armoa - Kilpi ja Käärme, osa 1" },
	["cu_usp-s_elegant"] = { name = "cu_usp-s_elegant", desc = "Maalattu koboltinsiniseksi ja koristeltu CT-logolla luistissa.\n\nVoin noudattaa protokollaa ja saada 7 turvaan, tai voin tehdä asiat omalla tyylilläni ja pelastaa kaikki 10. Sinun valintasi - Carmen Cocinero, saattoekspertti" },
	["hy_plaid2"] = { name = "hy_plaid2", desc = "Maalattu harmaanrusken ja sinivihreän ruutukuvion hydrografilla.\n\nSäkkipilli se ei ole, mutta soittaa silti hautajaisia edeltävän sävelmän." },
	["cu_fiveseven_urban_hazard"] = { name = "cu_fiveseven_urban_hazard", desc = "Maalattu urbaanilla maastokuviolla ja punaisella korostusvärillä.\n\nJoka vuosi Booth kerää maailman parhaimmat asesepät yhteen esittelemään uusia designejaan" },
	["an_emerald"] = { name = "an_emerald", desc = "Maalattu kromisella pohjavärillä ja päällystetty karamellisella läpikuultavalla smaragdinvihreän värisellä anodisoidulla tehostevärillä.\n\nTähänkö suuri Sebastien Hennequet on vajonnut? Nalkuttavaksi opettajaksi? Mitä sinulle oikein tapahtui... - Opettaja ja ikonoklasti osa 2" },
	["so_keycolors"] = { name = "so_keycolors", desc = "Yksittäisiä osia on spray-maalattu sinisellä ja oranssilla.\n\nTilien tasoittaja" },
	["cu_awp_mastery"] = { name = "cu_awp_mastery", desc = "Maalattu usealla hydrografilla, tarkalla sapluunalla ja ykstyiskohtaisilla siirtotarroilla.\n\nChase Turner oli hieno mies... sinulla on suuret saappaat täytettävänäsi - Feeniks ja tulokas, osa 1" },
	["aq_dualberettas_cartel"] = { name = "aq_dualberettas_cartel", desc = "Siihen on kaiverrettu luurankoja, kukkia ja käärmeitä.\n\nSiksi Huxley tekee kaikki raskaat hommat, meidän täytyy vain usuttaa häntä... - Käärme ja totuuden etsijä, osa 2" },
	["aq_famas_contour"] = { name = "aq_famas_contour", desc = "Maalattu modernilla punaisen ja harmaan värityksellä, mikä korostaa aseen muotoja.\n\nYhdessä olemme aina vahvempia" },
	["cu_nova_hyperbeast"] = { name = "cu_nova_hyperbeast", desc = "Siihen on maalattu psykedeelisillä väreillä hirviön kuva.\n\nSinut tunnetaan nimellä Oni, vai mitä? Niin pelottava nimi noin surkealle miehelle... – Elliot Kingsman, palkkasotilas" },
	["hy_ocean_knife"] = { name = "hy_ocean_knife", desc = "Se on maalattu sinisellä maastohydrografilla." },
	["cu_m4a1s_printstream"] = { name = "cu_m4a1s_printstream", desc = "Se on maalattu jyrkällä mustan ja valkoisen kontrastilla ja viimeistelty helmiäisyksityskohdilla.\n\nWHITE_1; BLACK_1; PEARLESCENT_1; SILENCED_1;" },
	["cu_usp_printstream"] = { name = "cu_usp_printstream", desc = "Mukautettu maalikerros koostuu suuren kontrastin mustavalkoisesta kuvioinnista ja helmimäisistä kohokohdista.\n\nVALKOINEN_1; MUSTA_1; HELMIMÄINEN_1; VAIMENNETTU_1; PISTOOLI_1;" },
